    name: age
    response:
    - label: 0 to 20
      value: 0-20
    - label: 20 to 40
      value: 20-40
    - label: 40 to 60
      value: 20-40
    - label: 40 to 60
      value: 40-60
    type: likert
  - label: Gender
    name: gender
    response:
    - label: Female
      value: female
    - label: Male
      value: male
    - label: Other
      value: other
    type: likert
  - label: Have you participated in image subjective evailation before
    name: subjective_eval_ever
    response:
    - label: 'Yes'
      value: 'yes'
    - label: 'No'
      value: 'no'
    type: likert
  showResults: false
  type: finish
  writeResults: true
